import React from 'react';


const Navbar=()=>{

    return(
        <div class Navbar>
            <div className='logo'>
                <img src="https://meme-token-gilt.vercel.app/assets/29231-B1Z16x30.png" alt="" />
                <p>URANUS</p>
            </div>
            <div>
                <button>Suraj</button>
            </div>
        </div>

    );
};

export default Navbar;
